WebDriver拾级而上·之一 环境部署


下载安装eclipse和jdk
下载最新的Selenium Client Drivers http://seleniumhq.org/download/
在eclipse中建立项目中导入所下载的包。（如果selenium-java-2.21.0.jar导入后，运行报错，则把下载的selenium-java-2.21.0.jar包中同一级目录下的libs中的jar包全部导入）

配置testng
4.1 Eclipse中点击Help-&gt;Install new software -&gt; 点击Add
4.2 在Location输入 http://beust.com/eclipse
4.3 选中Testng版本，点击Next，按照提示安装，安装完之后重启Eclipse
4.4 新建JavaProject，右键BuildPath，添加testng.jar
4.5 新建一个sum类，用来计算两整数之和，代码如下：
package com.hpp;
public class sum {
private int no1;private int no2;
 private int mysum;
 public int add(int no1,int no2){
 mysum=no1+no2;return mysum;
 }
}
4.6 再新建testng class


4.7 点击finish，代码如下
package com.test;
import org.testng.annotations.Test;
import static org.testng.Assert.assertEquals;
import com.hpp.sum;
public class NewTest {
private sum newSum=new sum();
@Test
public void f() {
   int mysum=newSum.add(1, 2);
   assertEquals(3,mysum,&quot;Right&quot;);
}
}
