TestNG·八 并发测试

一、 Concurrent testing:
下面的例子是输出进程ID，threadPoolSize用来指明线程池的大小，也就是并发的线程数目是多少
5次调用，有3个线程可调用
@Test(invocationCount = 5, threadPoolSize = 3,groups = { &quot;t9&quot;})
public void smallThreadPool() {
System.out.println(&quot;Thread#: &quot; +Thread.currentThread().getId());
}
页面输出
[TestNG] Running:
  E:\android\selenium\test_wdng_java\src\testing.xml
Thread#: 13
Thread#: 15
Thread#: 14
Thread#: 15
Thread#: 15
===============================================
Suite
Total tests run: 5, Failures: 0, Skips: 0
===============================================
若改成5次调用，有5个线程可调用
Thread#: 10
Thread#: 14
Thread#: 12
Thread#: 11
Thread#: 13
二、Concurrent running of tests
TestNG可以以多线程的模式运行所有的test，这样可以获得最大的运行速度，最大限度的节约执行时间。当然，并发运行也是有代价的，就是需要我们的代码是线程安全的。
并发运行测试的话，需要我们指定运行的配置文件，一个示例如下：
&lt;suite name=&quot;Concurrent Suite&quot; parallel=&quot;methods&quot; thread-count=&quot;2&quot; verbose=&quot;1&quot; &gt;
&lt;&gt;……&lt;&gt;
&lt;/suite&gt;
1.Parallel=”methods”的意思是指TestNG会将method作为并发的元子单位，即每个method运行在自己的thread中。如果parallel=”tests”,则指会将 test 作为并发的元子单位
2.Thread-count=”2”是指，运行的时候，并发度为2，同时会有两个线程在运行。
例：
@Test(groups = { &quot;t8&quot;})
public void aThreadPool() {
System.out.println(&quot;#ThreadA: &quot; +Thread.currentThread().getId());
}
@Test(groups = { &quot;t8&quot;})
public void bThreadPool() {
System.out.println(&quot;#ThreadB: &quot; +Thread.currentThread().getId());
}
@Test(groups = { &quot;t8&quot;})
public void cThreadPool() {
System.out.println(&quot;#ThreadC: &quot; +Thread.currentThread().getId());
}
--------------------------------------------------------------------
&lt;test name=&quot;Test&quot; parallel=&quot;methods&quot; thread-count=&quot;2&quot;&gt;
输出结果：
#ThreadB: 11
#ThreadC: 11
#ThreadA: 10
===============================================
Suite
Total tests run: 3, Failures: 0, Skips: 0
===============================================
改成&lt;test name=&quot;Test&quot; parallel=&quot;tests&quot; thread-count=&quot;2&quot;&gt;
页面输出(因为aThreadPool(),bThreadPool(),cThreadPool()都在一个test下面)
#ThreadA: 1
#ThreadB: 1
#ThreadC: 1
===============================================
Suite
Total tests run: 3, Failures: 0, Skips: 0
===============================================

webdriver_&_testngcan_shu_hua_ji_yong_li.body:
WebDriver &amp; TestNG·参数化及用例排序

一、一个简单的测试谷歌搜索
public class GoogleTest  {
    @Test
    public void search(ITestContext context) {
        WebDriver driver = new FirefoxDriver();
        driver.get(&quot;http://www.google.com&quot;);
        WebElement element = driver.findElement(By.name(&quot;q&quot;));
        element.sendKeys(&quot;乙烯&quot;);
        element.submit();
        Assert.assertTrue(driver.getTitle().contains(&quot;乙烯&quot;), &quot;Title is  wrong!&quot;);                          
    }
}
&lt;suite name=&quot;google demo&quot; verbose=&quot;2&quot;&gt;
    &lt;test name=&quot;Search function&quot;&gt;
        &lt;classes&gt;
            &lt;class name=&quot;test.GoogleTest&quot;&gt;
                &lt;methods&gt;
                    &lt;include name=&quot;search&quot; /&gt;
                &lt;/methods&gt;
            &lt;/class&gt;
        &lt;/classes&gt;
    &lt;/test&gt;
&lt;/suite&gt;
注：
1.verbose：执行的输出详细程度。因为testng会输出html格式的测试报告。因此该属性决定报告详细程度。程度值由0-10.0是没有，10是最详细。不是必需有的。
二、使测试更加灵活：

可以配置使用任意支持的浏览器进行测试；
配置所有Google的URL；
配置搜索的关键字。

修改后的代码如下：
public class GoogleTest  {
    WebDriver driver;

    @Parameters({&quot;browser&quot;})
    @BeforeTest
    public void setupBrowser(String browser){
        if (browser.equals(&quot;firefox&quot;)){
            driver = new FirefoxDriver();
        } else {
            driver = new ChromeDriver();
        }  
    }  

    @Parameters({ &quot;url&quot;, &quot;keyword&quot; })
    @Test
    public void search(String url, String keyword) {       
        driver.get(url);
        WebElement element = driver.findElement(By.name(&quot;q&quot;));
        element.sendKeys(keyword);
        element.submit();
        Assert.assertTrue(driver.getTitle().contains(keyword), &quot;Title is  wrong!&quot;);       
       }  
}
&lt;suite name=&quot;google demo&quot; verbose=&quot;2&quot;&gt;
    &lt;parameter name=&quot;browser&quot; value=&quot;firefox&quot; /&gt;
    &lt;parameter name=&quot;url&quot; value=&quot;http://www.google.com&quot; /&gt;
    &lt;parameter name=&quot;keyword&quot; value=&quot;乙烯&quot; /&gt;
    &lt;test name=&quot;Search function&quot; preserve-order=&quot;true&quot;&gt;
        &lt;classes&gt;
            &lt;class name=&quot;test.GoogleTest&quot;&gt;
                &lt;methods&gt;
                    &lt;include name=&quot;setupBrowser&quot; /&gt;
                    &lt;include name=&quot;search&quot; /&gt;
                &lt;/methods&gt;
            &lt;/class&gt;
        &lt;/classes&gt;
    &lt;/test&gt;
&lt;/suite&gt;
注：
1.利用TestNG的@Parameters标签，让测试方法从testng.xml里面读取参数，实现参数化。
参数化详解见：http://blog.sina.com.cn/s/blog_6966650401012lyn.html
2.在testng.xml的配置中，test节点需要增加一个属性的配置： preserve-order=”true”。这个preserve-order默认是false，在节点下面的所有方法的执行顺序是无序的。把它设为true以后就能保证在节点下的方法是按照顺序执行的。在上面代码中setupBrowser方法必须在search方法前执行！

