WebDriver &amp; TestNG·架构

一、架构图


对象库封装：系统会经历升级改版，每次改动可能会将原来用来定位的Key（Id,name,ccc...）改变，因而需要修改脚本，而脚本可能无数次的引用该改动的控件对象，查找替换是件非常繁琐的事情更有可能会有遗漏，所以如果将对象库放在数据库中，每次修改只需要修改数据库中的一条数据，这样后期的脚本维护会变得相当方便。考虑到执行效率，可以一次性把数据库中的控件对象库全部读到本地临时文件中，可以避免多次链接数据库操作。
事件封装：将控件操作、数据比对操作封装成函数。方便后续事件统一维护。
脚本开发：用java语言开发selenium脚本
脚本执行：客户端通过testNG起测试脚本，执行用例
报告生成：测试完毕，将测试结果转换成html文件，如果条件允许可以发邮件通知。

二、代码架构
com.wapm18.base 包：用来存放封装底层方法
com.wapm18.util包：用来存放公用方法
com.wapm18.testcase包：用来存放测试用例
suit文件夹：用来存放执行用例集

三、对象库构建
数据库脚本
