@Test(groups = {&quot;login&quot;})
public void login_username_empty(String login_name_txtUserName,String login_name_txtPwd,String login_name_btnLogin) throws Exception {
System.out.println(&quot;login_username_empty&quot;);
driver.manage().timeouts().implicitlyWait(10, TimeUnit.SECONDS);
